import axios from 'axios';

export function getFavoriteMovies(username) {
  return new Promise((resolve, reject) => {
    // Replace this with your actual login logic
    // For example, you can make an API call to your back-end for authentication
    // and resolve the promise based on the response
    console.log(username);

    axios
      .get('http://localhost:3000/getFavoriteMovies', { username }) // Specify the full URL including the port number
      .then(response => {
        // Assuming the backend responds with a success message
        if (response.data === 'Login successful!') {
          resolve(true);
        } else {
          resolve(false);
        }
      })
      .catch(error => {
        reject(error);
      });
  });
}
